import React from "react";

const CategoryCard = (props) => {
  return (
    <div className="container" id={props.id}>
      <div className="container-image">
        <img src={props.urlImage} alt="" />
      </div>
      <div className="container-content">
        <h3>{props.date}</h3>
        <h3>{props.title}</h3>
        <p>{props.content}</p>
      </div>
    </div>
  );
};

export default CategoryCard;
